_objectMoved(JSObject* obj, JSObject* old)
{
  mozilla::dom::DOMPointReadOnly* self = UnwrapPossiblyNotInitializedDOMObject<mozilla::dom::DOMPointReadOnly>(obj);
  if (self) {
    UpdateWrapper(self, self, obj, old);
  }

  return 0;
}

